import React from 'react';
import {
  Container,
  Slider
} from '@material-ui/core';

export default function App(){
  const marks = [
    {
      value: 1,
      label: 1
    },
    {
      value: 2,
      label: 2
    },
    {
      value: 3,
      label: 3
    },
    {
      value: 4,
      label: 4
    },
    {
      value: 5,
      label: 5
    }
  ];

  return(

    <Container>
      <Slider
        defaultValue={10}
        marks={marks}
        max={10}
        min={1}
        steps={10}/>
    </Container>
  )
};
